import React from 'react'
import {Container} from "react-bootstrap";

function Login() {
    return (
        <div id="login">
            <button>click</button>
            <Container>
            <div className="login">
                
                <p>rohithe please wait for a minute</p>
            </div>
            </Container>

        </div>
    )
}

export default Login
